import React, { Component} from "react";
import Home from "./home";

class App extends Component {
    constructor() {
        super();
        this.state = {
            page: 'home',
        }
    }

    componentDidMount() {}

    render() { 
        let content;
        if(this.state.page === 'home') {
            content = <Home />
        }

        return (
            <div>
                <h1>Artifice</h1>
                {content}
            </div>
        );
    }
}

export default App;
